import React from "react";
import "./footer.css";
import logo from "../../assets/img/logo-01.png";

const Footer = () => {
  return (
    <footer className="footer">
      <div className="container">
        <div className="footer__wrapper">
          <div className="footer__box">
            <div className="logo">
              <div className="logo__img">
                <img src={logo} alt="" />
              </div>
              <h2>Fitzone</h2>
            </div>
            <p>
              Lorem ipsum dolor sit amet consectetur adipisicing elit.
              Dignissimos ab iusto quos voluptates, totam voluptatibus itaque
              corporis, molestiae quod recusandae beatae quis assumenda hic,
              omnis temporibus veritatis asperiores. Minus, eos doloribus dicta
              ipsum soluta labore perspiciatis culpa architecto id corporis
              expedita doloremque quidem possimus delectus commodi rem aperiam
              quae adipisci.
            </p>
          </div>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
